svg.script:
(function () {
  "use strict";

  function init(){
    var leftEyeBulb = document.getElementById('left-eye-bulb');
    var rightEyeBulb = document.getElementById('right-eye-bulb');
    var screen = document.getElementById('Group-8-2');

    new TimelineMax().to(leftEyeBulb, 0, {display:'none', delay:.5}).to(leftEyeBulb, 0, {display:'block', delay:.5}).repeat(-1);
    new TimelineMax().to(rightEyeBulb, 0, {display:'none', delay:.5}).to(rightEyeBulb, 0, {display:'block', delay:.5}).delay(.5).repeat(-1);

    new TimelineMax().to(screen, .5, {y:"-=30"}).to(screen, 1, {y:"+=30", ease:Bounce.easeOut, delay:.2}).repeat(-1).repeatDelay(2);
  }

  window.addEventListener('load', init);
}());
